import React from 'react';
import ShopyHomeSlider from './ShopyHomeSlider';
import NewArrivals from './NewArrivals';
import BestSales from './BestSales';
import Newsletter from './NewsLetter';
import './Home.css';

const Home = () => {
		return (
			<div>
				<h2>HOME</h2>
				<ShopyHomeSlider />
				<NewArrivals />
				<BestSales />
				<Newsletter />
			</div>
		);
};

export default Home;
